import "./layout.scss";
const Layout = (props) => (
  <div className="page-layout" style={{ backgroundColor: props.bgColor }}>
    <div
      className="container row h-100"
    >
      <div className="my-auto w-100">
        <div className="d-block h-100 w-100">{props.children}</div>
      </div>
    </div>
  </div>
);
export default Layout;
